import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <h1>A Cooking Schedule</h1>
      <h2>Who will cook or woman?</h2>
      <div className="header-buttons">
        <button>Login</button>
        <button>Sign Up</button>
      </div>
    </header>
  );
};

export default Header;
